public class InnerResourceDefinitionVersionResourceDataContainerFactory(Action<Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer> factoryAction = null) : SubResourceFactory<Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer>
{

    internal InnerResourceDefinitionVersionSecretsManagerSecretResourceDataFactory SecretsManagerSecretResourceDataFactory { get; set; }

    internal InnerResourceDefinitionVersionSageMakerMachineLearningModelResourceDataFactory SageMakerMachineLearningModelResourceDataFactory { get; set; }

    internal InnerResourceDefinitionVersionLocalVolumeResourceDataFactory LocalVolumeResourceDataFactory { get; set; }

    internal InnerResourceDefinitionVersionLocalDeviceResourceDataFactory LocalDeviceResourceDataFactory { get; set; }

    internal InnerResourceDefinitionVersionS3MachineLearningModelResourceDataFactory S3MachineLearningModelResourceDataFactory { get; set; }

    protected override Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer Create()
    {
        var resourceDataContainerResult = CreateResourceDataContainer();
        factoryAction?.Invoke(resourceDataContainerResult);

        return resourceDataContainerResult;
    }

    private Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer CreateResourceDataContainer()
    {
        var resourceDataContainerResult = new Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer();

        return resourceDataContainerResult;
    }
    public override void CreateChildren(Humidifier.Greengrass.ResourceDefinitionVersionTypes.ResourceDataContainer result)
    {
        base.CreateChildren(result);

        result.SecretsManagerSecretResourceData ??= SecretsManagerSecretResourceDataFactory?.Build();
        result.SageMakerMachineLearningModelResourceData ??= SageMakerMachineLearningModelResourceDataFactory?.Build();
        result.LocalVolumeResourceData ??= LocalVolumeResourceDataFactory?.Build();
        result.LocalDeviceResourceData ??= LocalDeviceResourceDataFactory?.Build();
        result.S3MachineLearningModelResourceData ??= S3MachineLearningModelResourceDataFactory?.Build();
    }

} // End Of Class

